#!/bin/bash

# <xbar.title>Coinbase.com Bitcoin Prices</xbar.title>
# <xbar.version>v1.1</xbar.version>
# <xbar.author>Charles Lehnert</xbar.author>
# <xbar.author.github>binomialstew</xbar.author.github>
# <xbar.desc>Displays the current Bitcoin spot price in the menu bar as per Coinbase.com and allows configuration of decimals. Buy and sell prices can be seen in the menu.</xbar.desc>
# <xbar.image></xbar.image>
#
# <xbar.var>number(VAR_DECIMALS=2): The number of decimal places to display (max precision is 2).</xbar.var>
#

bitcoinIconBase64=''

spot_price=$(curl -s "https://api.coinbase.com/v2/prices/BTC-USD/spot" -H "CB-VERSION: 2017-04-16" | egrep -o "\d+\.\d{0,$VAR_DECIMALS}" | sed 's/\.$//')
buy_price=$(curl -s "https://api.coinbase.com/v2/prices/BTC-USD/buy" -H "CB-VERSION: 2017-04-16" | egrep -o "\d+\.\d{0,$VAR_DECIMALS}" | sed 's/\.$//')
sell_price=$(curl -s "https://api.coinbase.com/v2/prices/BTC-USD/sell" -H "CB-VERSION: 2017-04-16" | egrep -o "\d+\.\d{0,$VAR_DECIMALS}" | sed 's/\.$//')

printf "%.*f | templateImage=%s\n" "$VAR_DECIMALS" "$spot_price" "$bitcoinIconBase64"
echo "---"
printf "%s \t$%.${VAR_DECIMALS}f\n" "Spot price:" "$spot_price"
printf "%s \t$%.${VAR_DECIMALS}f\n" "Buy price:" "$buy_price"
printf "%s \t$%.${VAR_DECIMALS}f\n" "Sell price:" "$sell_price"
